cfa55e171caaf100d02a5c3f65c631b0:
query TokenQuery(
  $cookie: String!
) {
  redeemCookie(cookie: $cookie) {
    sameSession
    registered
    session
  }
}

fe716f6686c2e2093af181022fb2b2b8:
query RootQuery {
  authentication {
    user {
      username
    }
    ...JoinFragment
  }
}

fragment JoinFragment on Authentication {
  cookie {
    redeemed
    registered
    sameSession
    email
  }
}

